import React, {Component} from 'react';
import doc2 from "../Asset/doc2.jpg";
import doc from "../Asset/doc.jpg";
import {useNavigate} from "react-router";

class CreateHospitalPersonnel extends Component {
    constructor(props) {
        super(props);

        this.state = {
            name: '',
            dob: '',
            sex: '',
            email: '',
            numPager: '',
            password: '',
        }
    }

    changeNameHandler=(event) => {
        this.setState({name: event.target.value});
    }
    changeDOBHandler=(event) => {
        this.setState({name: event.target.value});
    }
    changeSexHandler=(event) => {
        this.setState({name: event.target.value});
    }
    changeEmailHandler=(event) => {
        this.setState({name: event.target.value});
    }
    changeNumPagerHandler=(event) => {
        this.setState({name: event.target.value});
    }
    changePasswordHandler=(event) => {
        this.setState({name: event.target.value});
    }

    render() {
        return (
            <section id="signupForm">
                <div className="form-images1">
                    <div id="form">
                        <div id="headerSignUp">
                            <h2> Create a new profile: </h2>
                        </div>
                        <div id="mainBox">
                            <div className="row">
                                <label>
                                    <b>Name:</b>
                                </label>
                                <input id="inputSignup" name="name"type="text"
                                       value={this.state.name} onChange={this.changeNameHandler}/>
                            </div>
                            <div className="row">
                                <label>
                                    <b>Pager Number:</b>
                                </label>
                                <input id="inputSignup" name="numPager" type="text"
                                value={this.state.numPager} onChange={this.changeNumPagerHandler}/>
                            </div>
                            <div className="row">
                                <label>
                                    <b>Email:</b>
                                </label>
                                <input id="inputSignup" name="email" type="email"
                                       value={this.state.email} onChange={this.changeEmailHandler}/>
                            </div>
                            <div className="row">
                                <label>
                                    <b>Password:</b>
                                </label>
                                // TODO: Add logic here to confirm passwords match
                                <input id="inputSignup" name="password" type="password"></input>
                            </div>
                            <div className="row">
                                <label>
                                    <b>Confirm Password:</b>
                                </label>
                                <input id="inputSignup" type="password"></input>
                            </div>
                            <div className="row">
                                <label htmlFor="role">
                                    <b>Role:</b>
                                </label>
                                <select name="role" id="role">
                                    <option value="empty"></option>
                                    <option value="JuniorDoctor">FY</option>
                                    <option value="SHO">SHO</option>
                                    <option value="Consultant">Spr/Cons</option>
                                </select>
                            </div>
                            <div id="actionButtons">
                                <button id="actionButton" onClick={null}>Register</button>

                                <button id="actionButton" onClick={null}>
                                    Return to login page
                                </button>
                            </div>
                        </div>
                    </div>

                    <div className="images">
                        <img src={doc2} id="docfemale" alt="docfemale" />
                        <img src={doc} id="docmale" alt="docmale" />
                    </div>
                </div>
            </section>
        );
    }
}

export default CreateHospitalPersonnel;
